import React from "react";
import Button from "@material-ui/core/Button";
import CreateOrderAPI from "../../components/createorder/create-order";
import {createStyles, makeStyles, Theme} from "@material-ui/core/styles";
const useStyles = makeStyles((theme: Theme) =>
    createStyles({
        root: {
            padding: "3rem",
        },
        form: {
            width: "100%",
        },
        input: {
            margin: "20px 0",
            "& input:valid + fieldset": {
                borderColor: "#008fe5",
                borderWidth: 1,
            },
            "& input:focus + fieldset": {
                borderColor: "#008fe5 !important",
                borderWidth: 1,
            },
            "& input:invalid + fieldset": {
                borderColor: "#ff6767",
                borderWidth: 1,
            },
        },

        margin: {
            margin: theme.spacing(1),
        },

        pay: {
            padding: "16px 0",
            boxShadow: "none",
            backgroundColor: "#008fe5",
            color: "#f9f9f9",
            "&:hover": {
                boxShadow: "none",
                backgroundColor: "#008fe5",
                color: "#f9f9f9",
            },
        },
    })
);


function OrderPage() {
    const classes = useStyles();
    async function handleOrder() {
        const orderAPI = await CreateOrderAPI();
        console.log("orderAPI: ", JSON.stringify(orderAPI, null, 2));
        // @ts-ignore
        window.location.href = orderAPI["order_url"].toString();
    }


    return (
        <>
            <Button variant={"outlined"}
                    style={{margin: "100 auto"}}
                    className={classes.pay}

                    onClick={() => handleOrder()}> CreateOrder </Button>
        </>
    )

}

export default OrderPage
